import '../App.css';
import {Button, Radio} from 'antd';



function TestApp() {
    return (
        <div>
            <Radio.Group>
                <Radio value="1">1</Radio>
                <Radio value="2">2</Radio>
                <Radio value="3">3</Radio>
            </Radio.Group>
        </div>
    )
}
export default TestApp
